import React from "react";

import MainHeader from './MainHeader';

function MainNavigation() {
  return (
    <React.Fragment>
      <MainHeader >
        <header>
          <h1>
            <Link to="/">Keeper</Link>
          </h1>
        </header>
      </MainHeader>
    </React.Fragment>
  );
}

export default MainNavigation;
